class BigNumberCalculationTest
{
    public static long testAdd(long a, long b)
    {
        return a + b;
    }

    public static long testSub(long a, long b)
    {
        return a - b;
    }

    public static long testMul(long a, long b)
    {
        return a * b;
    }

    public static long testDiv(long a, long b)
    {
        return a / b;
    }

}
